Althougt it is possible to implement LinkedList in Rust by Rc<RefCell<T>>, I do not know why leetcode refuse to use it. I would like to provide another implementation that supports fast and slow pointers approach. The key difficulty is moving pointer. use std::rc::Rc;
use std::cell::RefCell; #[derive(Debug, PartialEq)]
struct LinkedNode { val : i32, next : Option<Rc<RefCell<LinkedNode>>>,
} impl LinkedNode { fn new(val : i32, next: Option<Rc<RefCell<LinkedNode>>>) -> Option<Rc<RefCell<LinkedNode>>>{ Some( Rc::new( RefCell::new( LinkedNode{ val, next } ) ) ) }
} fn main() { let node_2 = LinkedNode::new(2, None); let node_1 = LinkedNode::new(1, node_2.clone() ); let head = LinkedNode::new(0, node_1); // Move pointer by flat_map let safe_fast_pointer = head.clone() .and_then(|n| {let n = n.borrow(); n.next.clone() }) .and_then(|n| {let n = n.borrow(); n.next.clone() }); assert_eq!(safe_fast_pointer, node_2); } For another way to use fast and slow pointers without re-implement the LinkedList, see: link from leetcode
